import { IconButton } from "@mui/material";
import { CloseSidebar, MiddleDivider, SidebarBg, SidebarBody, SidebarContainer, SidebarHeader, SidebarTitle } from "../../styles/dashboard/DashboardSidebar";
import ShoppingBagIcon from '@mui/icons-material/ShoppingBag';
import CloseIcon from '@mui/icons-material/Close';
import SidebarAccordian from "./SidebarAccordian";
import { useUIContext } from "../../context/ui";


export default function DashboardSidebar(){
    const {barActive} = useUIContext();
    return(
        <SidebarContainer sx={{ width: barActive ? '225px' : '50px' }}>          
            <SidebarBg></SidebarBg>
            <SidebarHeader>
                <IconButton><ShoppingBagIcon /></IconButton>
                <SidebarTitle variant="h4">My Bags</SidebarTitle>
                <CloseSidebar><CloseIcon/></CloseSidebar>
            </SidebarHeader>
            <MiddleDivider variant="midle"/>
            <SidebarBody>
                <SidebarAccordian/>
            </SidebarBody>
        </SidebarContainer>
    )
}
